import React from "react";
/* import { styled } from "@mui/system"; */
import { Button } from "@mui/material";



export default function AboutPageButton(name) {
  return (
    <>
      <Button disableRipple={true} style={{ background: "transparent" }}>
        {name}
      </Button> 
    </>
  );
}
